import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./Webimg/1.jpg";
import img2 from "./Webimg/2.jpg";
import img3 from "./Webimg/3.jpg";
import img4 from "./Webimg/4.jpg";
import img5 from "./Webimg/5.png";
import img6 from "./Webimg/6.png";
import img7 from "./Webimg/7.jpg";
import img8 from "./Webimg/8.jpg";
import img9 from "./Webimg/9.png";
import img10 from "./Webimg/10.png";
import img11 from "./Webimg/11.png";
import img12 from "./Webimg/12.png";
import "./Webdev.css";
function Webdev() {
  return (
    <div>
      <Container>
        <Row className="webrow-1">
          <Col className="webcol-1" lg={3}>
            <img src={img1} alt="" className="webimg1" />
            <img src={img2} alt="" className="webimg1" />
            <img src={img3} alt="" className="webimg1" />
            <img src={img4} alt="" className="webimg1" />
            <img src={img5} alt="" className="webimg1" />
            <img src={img6} alt="" className="webimg1" />
            <img src={img7} alt="" className="webimg1" />
            <img src={img8} alt="" className="webimg1" />
            <img src={img9} alt="" className="webimg1" />
            <img src={img10} alt="" className="webimg1" />
            <img src={img11} alt="" className="webimg1" />
            <img src={img12} alt="" className="webimg1" />
          </Col>
          <Col className="webcol-2" lg={6}>
            <h1 className="web-head1">MERNSTACK DEVELOPER</h1>
            <h1 className="web-head2">WEB DEVELOPMENT FULLSTACK</h1>
            <h4 className="web-head3">HTML</h4>
            <ul className="web-ul1">
              <li className="web-li1">What is HTML</li>
              <li className="web-li1">HTML Element</li>
              <li className="web-li1">HTML Heading</li>
              <li className="web-li1">HTML Paragraph</li>
              <li className="web-li1">HTML Image</li>
              <li className="web-li1">HTML Link</li>
              <li className="web-li1">HTML Formatting Tags</li>
              <li className="web-li1">
                HTML Pre,Address,Quotation and Cite Elements
              </li>
              <li className="web-li1">Absolute & Relative urls</li>
              <li className="web-li1">Bookmarks in HTML</li>
              <li className="web-li1">HTML Tables</li>
              <li className="web-li1">HTML Lists</li>
              <li className="web-li1">Div & Span Tags</li>
              <li className="web-li1">Class & Id Attributes</li>
              <li className="web-li1">Iframes</li>
              <li className="web-li1">Semantic Elements</li>
              <li className="web-li1">Figure & Figcaption Elements</li>
              <li className="web-li1">HTML Entities</li>
              <li className="web-li1">HTML Forms</li>
              <li className="web-li1">HTML Video & Audio</li>
            </ul>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Webdev;
